        </ScrollView>
      </View>
    );
  }
}

const styles = {
  titleStyle: {
    fontSize: 18,
    color: "#5BBC9D",
    paddingBottom: 10
  },
  contentStyle: {
    fontSize: 15,
    paddingTop: 10,
    paddingBottom: 15,
    lineHeight: 20
  }
};

export default TermsAndConditions;
